import PackageContext from "./Context"

const Provider = props =>{
    const [finalData, setFinalData] =useState({
        name:'',
        email:'',
        password:'',
        pincode:'',
        fulladdress:'',
        gender:'',
        state:'',
        districts:''
        })
        return(
            <FormData.Provider 
                value ={{data:finalData,
                setdata:()=>{
                    setFinalData({...finalData})
                }
                }}                
            >
                {props.children}
            </FormData.Provider>
        )
}
export default Provider
